import React from "react";
import "bootstrap/dist/css/bootstrap.css";

const NavBar = () => {
  return (
    <React.Fragment>
      <a class="navbar-brand mx-auto" href="#">
        NavBar
      </a>
    </React.Fragment>
  );
};

export default NavBar;
